import React from 'react'
import foodImages from './FoodImagesoodImages'

export default function MainPage() {
  return (
    <div>
      {foodImages.map((foodImage, index) => (
        <div key={index}>
          {foodImage.image}
          <h3>{foodImage.name}</h3>
          <p>{foodImage.description}</p>
        </div>
      ))}
    </div>
  )
}
